pragma solidity ^0.5.16;
pragma experimental ABIEncoderV2;

contract GeneralStorage {

    enum StorageType{ BYTES, UINT32, UINT64,UINT256,ARRAY,MAP }
    //   StorageType stype;
    struct Storage {
      address from;
      bytes value;
      bytes[] arraykeys;
      bytes[] arrayvalue;
    }

    // id => stage => storage
    mapping(bytes => mapping(bytes => Storage)) private _storage;

    // allow access contract address
    mapping(address => bool) private _accessAllowed;
    // set deploy address to allow access
    constructor()public{
        _accessAllowed[msg.sender] = true;
    }

    modifier isPlatform()  {
        require(_accessAllowed[msg.sender] == true,"the address not allowed the storage!");
        _;
    }

    function allowAccess(address _address) public isPlatform  {
        _accessAllowed[_address] = true;
    }

    function denyAccess(address _address) public isPlatform  {
        _accessAllowed[_address] = false;
    }

   function setStorage(bytes memory _id,bytes memory _stage,bytes memory _value)public isPlatform{
       Storage memory store_info;
       store_info.from = tx.origin;
    //    store_info.stype = _type;
       store_info.value = _value;
       _storage[_id][_stage] = store_info;
   }

   function setArrayStorage(bytes memory _id,bytes memory _stage,bytes[] memory _values)public isPlatform{
       Storage memory store_info;
       store_info.from = tx.origin;
    //    store_info.stype = _type;
       store_info.arrayvalue = _values;
       _storage[_id][_stage] = store_info;
   }

   function addArrayStorage(bytes memory _id,bytes memory _stage,bytes memory _value)public isPlatform{
       _storage[_id][_stage].arrayvalue.push(_value);
   }

   function setMapStorage(bytes memory _id,bytes memory _stage,bytes[] memory _keys,bytes[] memory _values)public isPlatform{
       Storage memory store_info;
       store_info.from = tx.origin;
    //    store_info.stype = _type;
       store_info.arraykeys = _keys;
       store_info.arrayvalue = _values;
       _storage[_id][_stage] = store_info;
   }

   function getStorage(bytes memory _id,bytes memory _stage) public view isPlatform  returns(address,bytes memory,bytes memory,bytes memory){
       Storage memory store_info = _storage[_id][_stage];
       return (store_info.from,_id,_stage,store_info.value);
   }

   function getMapStorage(bytes memory _id,bytes memory _stage) public view isPlatform  returns(address,bytes memory,bytes memory,bytes[] memory,bytes[] memory){
       Storage memory store_info = _storage[_id][_stage];
       return (store_info.from,_id,_stage,store_info.arraykeys,store_info.arrayvalue);
   }
}
